import React from 'react';
import classes from './Post.module.css';

const Post = (props) => {
    return (
      <div className={classes.content}>
        <p className={classes.item}>
            <p className={classes.item}>
              {props.message}
            </p>
            <p className={classes.underItem}>Likes: <span className={classes.value}></span></p>
        </p>
      </div>
    );
}
export default Post;
